@westcoastelitetrackclub is proud to announce we will be Honoring World Record Holder @sydneymclaughlin16 with our Award of Excellence. Sydney is not only a woman of great faith, but aligns with our team core values and exemplifies everything a West Coast Elite Girl represents. 

There is only 3 days left until our event with only a few tickets remaining so please make sure to get yours today. If you cannot attend you can still donate through the link in my bio.

Thank you in advance for your support!

WCE 1st Annual Bag Lady Fundraising Brunch was memorable and impactful.

We honored the amazingly talented and God fearing @sydneymclaughlin16 and met our fundraising goal for this event.

We wouldn’t have been able to meet these goals without the help of our trusted sponsors and parents!

Thanks To:
@blackgirlsunscreen 
@encoreevents90210 
@teamcodeblueig 
@theaagroup 
@iesha_irene 

Continue To Support Our Fundraising Efforts By Visiting Our Website & Be On The Lookout For Our Next Event Coming This Summer!!

